import {useState} from "react";

export const TableRow = ({option}: any) => {
  const [isExpand, setExpand] = useState(false)
  return (
    <>
      <tr>
        <td>{option.name}</td>
        <td>{option.balance}</td>
        <td>{option.email}</td>
        <td>{option.isActive ? 'Active' : 'Inactive'}</td>
      </tr>
    </>
  )
}
